import React from "react";
import { Typography, AppBar } from "@material-ui/core";


export default function App(){
    return(
        <div>
            <AppBar position="static" color="inherit">
                <Typography variant="h2" align="center">V</Typography>
            </AppBar>
        </div>
    );
}
